import { createMuiTheme } from '@material-ui/core/styles'

const theme = createMuiTheme({
    palette: {
        primary: {
            type: 'dark',
            light: '#6d6d6d',
            main: '#424242',
            dark: '#1b1b1b',
            contrastText: '#fff',
        },
        secondary: {
            light: '#ffff6e',
            main: '#cddc39',
            dark: '#99aa00',
            contrastText: '#000',
        },
    },
    centerCalendar: {
        width: '95vw',
        margin: 'auto',
    },
})

export default theme
